export const Menu = [
  {
    title: "Home",
  },
  {
    title: "Pages",
    path: "2",
    dropmenu: "sub-menu-down",
    content: [
      {
        subtitle: "About Us",
        to: "/about-us",
      },
      {
        subtitle: "Team",
        to: "/team",
      },
    ],
  },
  {
    title: "Portfolio",
    dropmenu: "sub-menu-down",
    path: "3",
    content: [
      {
        subtitle: "Portfolio",
        to: "/portfolio",
      },
    ],
  },

  {
    title: "Services",
    dropmenu: "sub-menu-down",
    path: "4",
    content: [
      {
        subtitle: "Services",
        to: "/services",
      },
      {
        subtitle: "Services Details",
        to: "/services-details",
      },
    ],
  },
  {
    title: "Blog",
    dropmenu: "sub-menu-down",
    path: "5",
    content: [
      {
        subtitle: "Blog Grid",
        to: "/blog-grid",
      },
    ],
  },
  {
    title: "Contact Us",
    to: "/contact-us",
    path: "5",
  },
];
